[{"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "clinvar"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "clinvar"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT (COUNT(?variant) as ?count)
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           cvo:variation_type "single nucleotide variant" ;
           cvo:record_status "current" .
}"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX nando: <http://nanbyodata.jp/ontology/nando#>

SELECT DISTINCT ?disease ?label ?id
WHERE {
  ?disease a nando:NANDO_0000001 ;
           rdfs:label ?label ;
           dcterms:identifier ?id .
  FILTER(CONTAINS(LCASE(STR(?label)), "parkinson"))
}
LIMIT 10
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?disease ?label
WHERE {
  ?disease rdfs:label ?label .
  FILTER(CONTAINS(LCASE(STR(?label)), "parkinson"))
}
LIMIT 20
"}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?nando_id ?label_ja ?label_en
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
    ?Nando a owl:Class ;
        dct:identifier ?nando_id ;
        rdfs:label ?label_ja .
    OPTIONAL {
        ?Nando rdfs:label ?label_en .
        FILTER(lang(?label_en) = "en")
    }
    FILTER(
        CONTAINS(LCASE(STR(?label_ja)), "パーキンソン") ||
        CONTAINS(LCASE(STR(?label_en)), "parkinson")
    )
}
LIMIT 20
"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?molecule ?moleculeLabel ?chemblId ?ic50Value ?target ?targetLabel
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?ic50Value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay ?assay .

  ?assay cco:hasTarget ?target .

  ?target a cco:SingleProtein ;
          rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" .

  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .

  ?targetLabel bif:contains "'kinase'" option (score ?sc)

  FILTER(xsd:decimal(?ic50Value) < 10)
}
ORDER BY ?ic50Value DESC(?sc)
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?chemblId ?moleculeLabel ?ic50Value ?targetLabel ?targetChemblId
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?ic50Value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay ?assay .

  ?assay cco:hasTarget ?target .

  ?target a cco:SingleProtein ;
          rdfs:label ?targetLabel ;
          cco:chemblId ?targetChemblId ;
          cco:organismName "Homo sapiens" .

  ?molecule rdfs:label ?moleculeLabel ;
            cco:chemblId ?chemblId .

  ?targetLabel bif:contains "'kinase'" option (score ?sc)

  FILTER(xsd:decimal(?ic50Value) > 0 && xsd:decimal(?ic50Value) < 10)
}
ORDER BY ?ic50Value DESC(?sc)
LIMIT 200"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?targetLabel (COUNT(DISTINCT ?molecule) as ?moleculeCount) (COUNT(DISTINCT ?activity) as ?activityCount)
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?ic50Value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay ?assay .

  ?assay cco:hasTarget ?target .

  ?target a cco:SingleProtein ;
          rdfs:label ?targetLabel ;
          cco:organismName "Homo sapiens" .

  ?targetLabel bif:contains "'kinase'"

  FILTER(xsd:decimal(?ic50Value) > 0 && xsd:decimal(?ic50Value) < 10)
}
GROUP BY ?targetLabel
ORDER BY DESC(?moleculeCount)
LIMIT 50"}}]
